import React from 'react'; 
import Form from 'react-bootstrap/Form';

import * as styles from './ContinentDropdown.module.scss'; 

const ContinentDropdown = () => {
    return (
        <div className={styles.dropdownWrapper}>
            <div className={styles.dropdownHeader}>
                <div className={styles.dropdownTitle}>Select Continent</div>
            </div>  

            <div className={styles.dropDownList}>
                <div className={styles.dropDownListItem}>Asia</div>
                <div className={styles.dropDownListItem}>Europe</div>
                <div className={styles.dropDownListItem}>South America</div>
                <div className={styles.dropDownListItem}>North America</div>
                {/* <div className={styles.dropDownListItem}>Africa</div> */}
            </div> 
        </div>
    )
}

export default ContinentDropdown;
